    (function() {
        const oblock = document.getElementById('orders');
        for(var i = orders.length - 1; i >= 0; i--) {
            const o = orders[i];
            if (o.state === 'filled') {
                const time = o.createdYear + ':' + o.createdMonth + ':' + o.createdDay + ' ' + o.createdHour + ':' +
                    o.createdMinute + ':' + o.createdSecond;
                const word = o.quantity + ' @ ' + o.price;
                const span = document.createElement('span');
                span.appendChild(document.createTextNode(time));
                span.appendChild(document.createElement('br'));
                span.appendChild(document.createTextNode(word));
                span.setAttribute('class', 'order ' + o.side);
                const checkbox = document.createElement('input');
                checkbox.setAttribute('type', 'checkbox');
                span.appendChild(checkbox);
                oblock.appendChild(span);
            }
        }
    })();

    function simplify() {
        document.querySelectorAll('span.order input[type="checkbox"]').forEach(function(cb) {
            if (cb.checked) {
                const p = cb.parentElement;
                p.parentElement.removeChild(p);
            }
        });
    }
</script>
